                <div className="profile-container">
                   <img src={this.props.myPhoto} className="myPhoto"/>
                   <h1 className="profile-name">{this.props.name}
                   </h1>
                   <hr className="sub-name-hr"/>
                <h4 className="role">{this.props.role}</h4>
